import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { useDispatch, useSelector } from 'react-redux';
import { updateProduct, updateLocalProduct } from '../features/products/ProductSlice';

const EditProductPage = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const products = useSelector(state => state.products.items);
  const localProducts = useSelector(state => state.products.localItems);

  const productFromAPI = products.find(product => product.id.toString() === id);
  const productFromLocal = localProducts.find(product => product.id.toString() === id);

  const [product, setProduct] = useState(productFromAPI || productFromLocal || {});
  const [loading, setLoading] = useState(!productFromAPI && !productFromLocal);

  useEffect(() => {
    if (productFromAPI || productFromLocal) {
      setLoading(false);
    } else {
      const fetchProduct = async () => {
        try {
          const response = await axios.get(`https://fakestoreapi.com/products/${id}`);
          setProduct(response.data);
          setLoading(false);
        } catch (error) {
          console.error('Error fetching product:', error);
        }
      };

      fetchProduct();
    }
  }, [id, productFromAPI, productFromLocal]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setProduct((prevProduct) => ({
      ...prevProduct,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (productFromAPI) {
      try {
        await dispatch(updateProduct(product)).unwrap();
        navigate('/products');
      } catch (error) {
        console.error('Error updating product:', error);
      }
    } else if (productFromLocal) {
      dispatch(updateLocalProduct(product));
      navigate('/products');
    }
  };

  if (loading) {
    return <p>Loading...</p>;
  }

  return (
    <div className="flex justify-center">
      <form onSubmit={handleSubmit} className="w-full max-w-md bg-white p-8 border rounded shadow-md">
        <h2 className="text-2xl font-bold mb-6">Edit Product</h2>
        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Title</label>
          <input
            type="text"
            name="title"
            value={product.title}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Price</label>
          <input
            type="number"
            name="price"
            value={product.price}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Description</label>
          <textarea
            name="description"
            value={product.description}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Category</label>
          <input
            type="text"
            name="category"
            value={product.category}
            onChange={handleChange}
            className="w-full p-2 border rounded"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Published</label>
          <input
            type="checkbox"
            name="published"
            checked={product.published}
            onChange={handleChange}
            className="mr-2"
          />
          Yes
        </div>
        <button type="submit" className="bg-blue-500 text-white p-2 rounded">Update Product</button>
      </form>
    </div>
  );
};

export default EditProductPage;
